import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import AboutSection from './LandingPage/AboutSection'; // Assuming correct folder structure
import ContactSection from './LandingPage/ContactSection'; // Assuming correct folder structure
import Dashboard from './LandingPage/Dashboard'; // Assuming correct folder structure

const Navigation = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/about">About</Link>
        </li>
        <li>
          <Link to="/contact">Contact</Link>
        </li>
      </ul>
    </nav>
  );
};

const App = () => {
  return (
    <Router>
      <div>
        <Navigation />
        <Switch>
          <Route path="/about" component={AboutSection} />
          <Route path="/contact" component={ContactSection} />
          <Route path="/" component={Dashboard} />
        </Switch>
      </div>
    </Router>
  );
};

ReactDOM.render(<App />, document.getElementById('root'));
